rules.rule:
A change to mixtures of dried vegetables from single dried vegetables from within this subheading or any other subheading, provided that:

- a) the net weight of non-originating cabbage, carrots, courgettes, cucumbers, gherkins, globe artichokes, mushrooms, potatoes, sweet corn, sweet peppers, tomatoes and turnips of Chapter 7 used in production does not exceed 20 per cent of the net weight of the product, *and* 

- b) the net weight of non-originating vegetables of Chapter 7 used in production does not exceed 50 per cent of the net weight of the product;

A change to mixtures containing blueberry juice, cranberry juice, elderberry juice, loganberry juice or Saskatoon berry juice from any other subheading, except from non-originating blueberry juice, cranberry juice, elderberry juice, loganberry juice or Saskatoon berry juice of heading 20.09, provided that:

- a) the net weight of non-originating juice of heading 20.09 in single strength form used in production does not exceed 40 per cent of the net weight of the product, *and* 

- b) the net weight of non-originating sugar used in production does not exceed 20 per cent of the net weight of the product;

A change to beverages containing milk from any other heading, except from heading 04.01 through 04.06 or dairy preparations of subheading 1901.90 containing more than 10 per cent by dry weight of milk solids, provided that:

- a) the net weight of non-originating sugar used in production does not exceed 20 per cent of the net weight of the product, *and* 

- b) the net weight of non-originating material of heading 04.07 through 04.10 used in production does not exceed 20 per cent of the net weight of the product;
